import PIXI from "pixi.js";
import * as utils from "./webgl.utils";
import {Node, Spark} from "./webgl.models";

class SparksEngine {
  constructor(config) {
    this.config = config;
    this.state = {
      "blurActive": false,
      "isPaused": false,
      "nodes": [],
      "sparks": [],
    };
    this.textures = {};

    this.world = PIXI.autoDetectRenderer(this.config.canvasWidth, this.config.canvasHeight, {
      "view": document.getElementById("sparks"),
      "backgroundColor": parseInt(this.config.backgroundColor.replace("#", ""), 16),
    });
    this.world.clearBeforeRender = false;

    this.stage = new PIXI.Container();
    this.worldBackground = new PIXI.Container();
    this.nodeContainer = new PIXI.Container();

    this.stage.addChild(this.worldBackground);
    this.stage.addChild(this.nodeContainer);

    this.initialize();
    this.loop();
  }

  idle() {
    if (this.state.isPaused) {
      requestAnimationFrame(this.idle.bind(this));
    } else {
      requestAnimationFrame(this.loop.bind(this));
    }
  }

  initialize() {
    // Draw our node texture
    let graphics = new PIXI.Graphics();
    graphics.beginFill(parseInt(this.config.nodeColor.replace("#", ""), 16));
    graphics.drawCircle(0, 0, 2);
    graphics.endFill();

    // Now we generate the full node texture
    let nodeTexture = graphics.generateTexture();

    let sparksBG = "data:image/png;base64,";
    let nodeGlow = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABcAAAAXBAMAAAASBMmTAAAAD1BMVEX///////////////////+Rd1MVAAAABXRSTlMBBgoSDki7qN8AAABRSURBVBjTYyABMAoKCiDYQADjCAopKcGkGIFsIA8qoaTi4qKkKADluBibOAE5YFUqzsbGLkqCUI6xsbEJYQ5CD8I0THsQLkC4DdXVCB4p3gcAk4kOooaNoloAAAAASUVORK5CYII=";
    let nodeGlowActive = "data:image/png;base64,";

    this.textures.nodeTexture = nodeTexture;
    this.textures.sparksBG = new PIXI.Texture.fromImage(sparksBG);
    this.textures.nodeGlow = new PIXI.Texture.fromImage(nodeGlow);
    this.textures.nodeGlowActive = new PIXI.Texture.fromImage(nodeGlowActive);

    let backgroundImage = new PIXI.Sprite(this.textures.sparksBG);
    backgroundImage.cacheAsBitmap = false;

    this.worldBackground.addChild(backgroundImage);

    for (let i = 0; i < this.config.nodeCount; i++) {
      let node = new Node(false, false, this.config, this.textures.nodeTexture);
      console.log(node.velocity);

      // Attach a 'glow' to each node.
      let nodeBackground = new PIXI.Sprite(this.textures.nodeGlow);
      node.addChild(nodeBackground);

      nodeBackground.position.x = -9.5;
      nodeBackground.position.y = -9.5;

      this.nodeContainer.addChild(node);
    }
  }

  pause() {
    this.state.isPaused = true;
  }

  play() {
    this.state.isPaused = false;
  }

  loop() {
    if (this.state.isPaused) {
      requestAnimationFrame(this.idle.bind(this));
    } else {
      requestAnimationFrame(this.loop.bind(this));
    }

    this.world.render(this.stage);

    this.nodeContainer.children.forEach(function(e, i) {
      if (0 < e.position.x + e.velocity.x && e.position.x + e.velocity.x < this.config.canvasWidth) {
        e.position.x += e.velocity.x;
      } else {
        e.velocity.x = -e.velocity.x;
        e.position.x += e.velocity.x;
      }

      if (0 < e.position.y + e.velocity.y && e.position.y + e.velocity.y < this.config.canvasHeight) {
        e.position.y += e.velocity.y;
      } else {
        e.velocity.y = -e.velocity.y;
        e.position.y += e.velocity.y;
      }

      // Reset "Drawn" state for lines
      e.hasDrawn = false;

      e.step();
    }, this);
  }
}

let engine = new SparksEngine({
  "backgroundColor": "#12487B",
  "canvasHeight": 900,
  "canvasWidth": 1600,
  "nodeColor": "#0F97F7",
  "nodeCount": 300,
  "nodeReach": 75,
  "maxFPS": 60,
  "maxOpacity": 0.4,
  "sparkColor": "rgba(255, 255, 255, 0.4)",
  "sparkLifetime": 500
});